import styled from "styled-components"

const Side = styled.aside`
    width: ${props.width};
    min-width: ${props.minWidth};
    max-width: ${props.maxWidth};
    ${props.customStyle};
`;

export default function Aside({
    children,
    width = 'auto',
    minWidth = '',
    maxWidth = '',
    customStyle = '',
}) {

    return (
        <Side {...props}>
            {children}
        </Side>
    );
}
